import React, { useState } from "react";
import Sidebar from "./Sidebar";
import { Search, SlidersHorizontal, UserCog, Users, User } from "lucide-react";

const teachersData = [
  {
    name: "Abinash Shrestha",
    email: "abinashshrestha@gmail.com",
    role: "Teachers",
    lastLogin: "2025-06-20, 09:15 PM",
  },
  // Add more teacher objects as needed
];

const adminData = [
  {
    name: "Admin User",
    email: "admin@example.com",
    role: "Admin",
    lastLogin: "2025-06-18, 10:00 AM",
  },
  // Add more admin objects as needed
];

const studentsData = [
  {
    name: "Student User",
    email: "student@example.com",
    role: "Student",
    lastLogin: "2025-06-19, 11:30 AM",
  },
  // Add more student objects as needed
];

const AdminSection = () => {
  const [search, setSearch] = useState("");
  const [activeTab, setActiveTab] = useState("teachers");

  const getFilteredData = () => {
    let data = [];
    if (activeTab === "teachers") data = teachersData;
    if (activeTab === "admins") data = adminData;
    if (activeTab === "students") data = studentsData;
    return data.filter((item) =>
      item.email.toLowerCase().includes(search.toLowerCase())
    );
  };

  const tabConfig = [
    {
      key: "teachers",
      label: "Teachers",
      icon: <User className="mr-2" size={18} />,
      count: teachersData.length,
    },
    {
      key: "admins",
      label: "Admins",
      icon: <UserCog className="mr-2" size={18} />,
      count: adminData.length,
    },
    {
      key: "students",
      label: "Students",
      icon: <Users className="mr-2" size={18} />,
      count: studentsData.length,
    },
  ];

  const filteredData = getFilteredData();

  return (
    <div className="flex min-h-screen bg-gray-50">
      <Sidebar />
      <div className="flex-1 flex flex-col ml-64">
        <header className="p-6 pb-2">
          <h1 className="text-xl font-semibold">Admin Section</h1>
        </header>
        <main className="flex-1 p-6 pt-0">
          {/* Tabs */}
          <div className="flex gap-4 mb-6">
            {tabConfig.map((tab) => (
              <button
                key={tab.key}
                className={`flex items-center px-6 py-2 rounded-md border shadow bg-white font-medium transition-colors ${
                  activeTab === tab.key
                    ? "border-blue-600 text-blue-600"
                    : "border-gray-200 text-gray-700 hover:bg-blue-50"
                }`}
                onClick={() => setActiveTab(tab.key)}
              >
                {tab.icon}
                {tab.label}
                <span className="ml-2 bg-gray-200 px-2 py-0.5 rounded text-xs font-semibold">
                  {tab.count}
                </span>
              </button>
            ))}
          </div>
          {/* Search */}
          <div className="mb-4 flex items-center">
            <div className="relative w-full">
              <span className="absolute left-3 top-2.5 text-gray-400">
                <Search size={18} />
              </span>
              <input
                type="text"
                className="w-full border rounded px-10 py-2 focus:outline-none"
                placeholder={`Search by email`}
                value={search}
                onChange={(e) => setSearch(e.target.value)}
              />
            </div>
          </div>
          {/* Table */}
          <div className="overflow-x-auto">
            <table className="min-w-full bg-white rounded shadow">
              <thead>
                <tr className="bg-gray-200 text-gray-700">
                  <th className="py-2 px-4 text-left font-medium">Name</th>
                  <th className="py-2 px-4 text-left font-medium">Email</th>
                  <th className="py-2 px-4 text-left font-medium">Roles</th>
                  <th className="py-2 px-4 text-left font-medium">Last Login</th>
                  <th className="py-2 px-4"></th>
                </tr>
              </thead>
              <tbody>
                {filteredData.length === 0 ? (
                  <tr>
                    <td colSpan={5} className="text-center py-4 text-gray-500">
                      No {activeTab} found.
                    </td>
                  </tr>
                ) : (
                  filteredData.map((item, idx) => (
                    <tr key={idx} className="border-b last:border-b-0">
                      <td className="py-2 px-4">{item.name}</td>
                      <td className="py-2 px-4">{item.email}</td>
                      <td className="py-2 px-4">{item.role}</td>
                      <td className="py-2 px-4">{item.lastLogin}</td>
                      <td className="py-2 px-4 text-right">
                        <button className="p-1 hover:bg-gray-100 rounded">
                          <SlidersHorizontal size={18} />
                        </button>
                      </td>
                    </tr>
                  ))
                )}
              </tbody>
            </table>
          </div>
        </main>
      </div>
    </div>
  );
};

export default AdminSection;
